import React from "react";
import { Link } from "react-router-dom";
import "../assets/styles.css";
import "../assets/home-dark.css";

import logoNuevo from "../assets/img/logonuevo.png";
import lootroomTextLogo from "../assets/img/lootroomlogo.png";
import rustypotTextLogo from "../assets/img/rustypotlogo.png";

export default function Home() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  return (
    <div className="home-dark has-video-bg">
      <header className="TopBar TopBar--home">
        <nav className="TopBar-links TopBar-links--left" aria-label="Navegación">
          <Link to="/reglas" className="nav-btn">Rules</Link>
          <Link to="/equipos" className="nav-btn">Teams</Link>
          <Link to="/events" className="nav-btn">Stats</Link>
        </nav>
      </header>

      <main className="home-hero">
        <img className="home-hero-logo" src={logoNuevo} alt="Rustaco" />
        <div
          style={{
            marginTop: "0.4rem",
            display: "flex",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              padding: "0.6rem 1.6rem",
              borderRadius: 999,
              background:
                "linear-gradient(90deg, rgba(0,0,0,0.78), rgba(226,88,34,0.42))",
              border: "1px solid rgba(255,255,255,0.22)",
              boxShadow: "0 12px 36px rgba(0,0,0,0.8)",
              display: "inline-flex",
              alignItems: "center",
              gap: 10,
            }}
          >
            <span
              style={{
                textTransform: "uppercase",
                fontSize: "0.78rem",
                letterSpacing: "2px",
                color: "rgba(255,255,255,0.88)",
                fontWeight: 800,
              }}
            >
              Rustaco III
            </span>
            <span
              style={{
                color: "#fff",
                fontWeight: 800,
                fontSize: "1.15rem",
                letterSpacing: "1px",
                textShadow: "0 2px 10px #000",
              }}
            >
              February 26 to March 1
            </span>
          </div>
        </div>
      </main>

      <footer
        style={{
          position: "relative",
          zIndex: 20,
          padding: "0.9rem 1.5rem 1.6rem",
          textAlign: "center",
          color: "#b3cfff",
          fontSize: "0.95rem",
          marginTop: "auto",
          background:
            "linear-gradient(90deg, rgba(8,8,10,0.78), rgba(226,88,34,0.18), rgba(114,137,218,0.12))",
          borderTop: "1px solid rgba(255,255,255,0.18)",
          boxShadow: "0 -10px 34px rgba(0,0,0,0.6)",
          backdropFilter: "blur(12px)",
          WebkitBackdropFilter: "blur(12px)",
        }}
      >
        <div style={{ marginBottom: "0.6rem", fontWeight: 600 }}>
          © Derechos reservados Rustaco Events
        </div>

        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            gap: 16,
            flexWrap: "wrap",
          }}
        >
          {/* Discord */}
          <a
            href="https://discord.rustaco.site"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              gap: 8,
              padding: "0.45rem 1.3rem",
              borderRadius: 999,
              background:
                "linear-gradient(90deg, #5865f2 0%, #3a4bd8 60%, #23201a 100%)",
              color: "#fff",
              fontWeight: 700,
              fontSize: "0.95rem",
              textDecoration: "none",
              boxShadow: "0 6px 20px rgba(0,0,0,0.7)",
            }}
          >
            Discord
          </a>

          {/* Lootroom logo de texto */}
          <a
            href="https://lootroom.com/"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              justifyContent: "center",
              padding: "0.2rem 1.1rem",
              borderRadius: 999,
              background:
                "linear-gradient(135deg, rgba(255,255,255,0.18), rgba(255,255,255,0.06))",
              border: "1px solid rgba(255,255,255,0.35)",
              boxShadow: "0 4px 16px rgba(0,0,0,0.65)",
            }}
          >
            <img
              src={lootroomTextLogo}
              alt="Lootroom"
              style={{
                height: 30,
                width: "auto",
                objectFit: "contain",
                filter: "drop-shadow(0 4px 10px rgba(0,0,0,0.6))",
              }}
            />
          </a>

          {/* Rustypot logo de texto */}
          <a
            href="https://rustypot.com/"
            target="_blank"
            rel="noopener noreferrer"
            style={{
              display: "inline-flex",
              alignItems: "center",
              justifyContent: "center",
              padding: "0.2rem 1.1rem",
              borderRadius: 999,
              background:
                "linear-gradient(135deg, rgba(255,255,255,0.18), rgba(255,255,255,0.06))",
              border: "1px solid rgba(255,255,255,0.35)",
              boxShadow: "0 4px 16px rgba(0,0,0,0.65)",
            }}
          >
            <img
              src={rustypotTextLogo}
              alt="Rustypot"
              style={{
                height: 30,
                width: "auto",
                objectFit: "contain",
                filter: "drop-shadow(0 4px 10px rgba(0,0,0,0.6))",
              }}
            />
          </a>
        </div>
      </footer>
    </div>
  );
}
